import React from 'react'

function Button() {
    const img = require('../img/unnamed.jpg')
    return (
        <div style={{width: "max", height: 50, background: "red", position:"relative"}}>
            <div>
                <input type={"text"} style={{right: 0, position: "absolute", top: "25%",
                                             margin: "auto", padding: "10"}} />
            </div>
        </div>
    )
}

export default Button
